Massa pronta para <strong>tapioca</strong> DABRANCA feita a partir da fécula de mandioca, também conhecida por polvilho doce. Recomendada para pessoas que estão em <strong>reeducação alimentar</strong> em busca do emagrecimento. Por não conter glúten é uma ótima substituto do pão no café da manhã.
Principais benefícios da tapioca:
Excelente <strong>fonte de fibras</strong>;
Fonte de <strong>vitamina K, cálcio e ferro</strong>, importante para a saúde óssea;
<strong>Rica em potássio</strong>;
Fonte de <strong>energia para atletas</strong>.
Modo de preparo:
1.	Peneirar em uma frigideira a Massa para Tapioca DABRANCA;
2.	Espalhe uniformemente 80-100g da massa modelando como uma panqueca;
3.	Aguarde aproximadamente 1 minuto, vire-a e aguarde mais 1 minuto;
4.	Coloque o recheio de sua preferência e feche a tapioca.

Ingredientes: Amido de mandioca e água. NÃO CONTÉM GLÚTEN

